import { NavLink } from 'react-router-dom';
import styles from './Navbar.Module.css';


const Navbar = () => {
  return (
   <nav className={styles.navbar}>
    <NavLink to="/">
        Mini <span>Blog</span>
    </NavLink>
    <ul>
        <li>
            <NavLink to="/">
                In√≠cio
            </NavLink>
        </li>
        <li>
        <NavLink to="/about">
                Sobre
            </NavLink>
        </li>
    </ul>
   </nav>
  );
};

export default Navbar;
